local MAJOR,MINOR = "SpellInfo-3.0", 1

local SpellInfo, oldminor = LibStub:NewLibrary(MAJOR, MINOR)

if not SpellInfo then return end -- no upgrade needed

local low,gsub,getn,find,tinsert = string.lower,string.gsub,table.getn,string.find,table.insert

local spellDB, spellSchool, castingTime, spellRange, rankPatterns, iconsDB

function trim(s)
  return gsub(gsub(s,"^%s+", ""),"%s+$", "")
end

-- Returns: name, rank, icon, castTime, minRange, maxRange, spellSchool
function SpellInfo:GetSpellInfoById(id)
	Sea.io.print(id)
	if type(id) == "number" and spellDB[id] then
		local s = spellDB[id]
		return s.n, s.r, iconsDB[s.i or 1], castingTime[s.c or 1], spellRange[s.ra].mn, spellRange[s.ra].mx, spellSchool[s.s]
	end
end

-- Returns: manaCost
function SpellInfo:GetSpellPowerCost(id)
	if type(id) == "number" and spellDB[id] then
		return spellDB[id].m or 0
	end
end

function SpellInfo:GetSpellIdByIcon(Icon)
	if type(Icon) ~= "string" then return end
	local shortIcon
	
	for x in string.gfind(Icon,"[^\\]+") do
		shortIcon = x
	end
	local iconid
	for k,v in pairs(iconsDB) do
		if v == shortIcon or v == Icon then
		  iconid = k
		  break
		end
	end
	
	if not iconid then return end
	
	local resultArray = {}
	for id, v in pairs(spellDB) do
		if v.i == iconid then
			tinsert(resultArray, id)
		end
	end
	if getn(resultArray) == 1 then
		return resultArray[1]
	elseif getn(resultArray) > 1 then
		return resultArray
	end
end

local function getRankFromName(name)
	local _, rank
	for k, pt in rankPatterns do
		_, _, rank = find(name,pt)
		if rank then
			return rank
		end
	end
end

function SpellInfo:GetSpellIdByName(Name)
	if type(Name) ~= "string" then return end
	
	Name = trim(Name)
	local rank = getRankFromName(Name)
	local shortName = rank and gsub(Name,rank,"") or Name
	
	Name = low(Name)	
	rank = rank and low(rank) or nil
	shortName = trim(low(shortName))
	
--	print(Name,rank,shortName)
	
	local resultArray = {}
	for id, v in pairs(spellDB) do
		local name = low(v.n)
		local crank = low(v.r or "")
		--print(name, crank)
		if rank then
			if rank == crank and (name == shortName or name == Name) then
				tinsert(resultArray, id)
			end
		elseif (name == shortName or name == Name) then
			tinsert(resultArray, id)
		end
	end
	if getn(resultArray) == 1 then
		return resultArray[1]
	elseif getn(resultArray) > 1 then
		return resultArray
	end
end



function SpellInfo:GetSpellIdByIconAndName(Icon, Name)
	if type(Icon) ~= "string" then return end
	if type(Name) ~= "string" then return end
	
	local shortIcon
	
	for x in string.gfind(Icon,"[^\\]+") do
		shortIcon = x
	end
	local iconid
	for k,v in pairs(iconsDB) do
		if v == shortIcon or v == Icon then
		  iconid = k
		  break
		end
	end

	if not iconid then return end
	
	Name = trim(Name)
	local rank = getRankFromName(Name)
	local shortName = rank and gsub(Name,rank,"") or Name
	
	Name = low(Name)	
	rank = rank and low(rank) or nil
	shortName = trim(low(shortName))
	local resultArray = {}
	for id, v in pairs(spellDB) do
		local name = low(v.n)
		local crank = low(v.r or "")
		--print(name, crank)
		if rank then
			if v.i and v.i == iconid and rank == crank and (name == shortName or name == Name) then
				tinsert(resultArray, id)
			end
		elseif v.i and v.i == iconid and (name == shortName or name == Name) then
			tinsert(resultArray, id)
		end
	end
	if getn(resultArray) == 1 then
		return resultArray[1]
	elseif getn(resultArray) > 1 then
		return resultArray
	end
	
end



